import React, { Component } from "react";
import ReactMapGL from "react-map-gl";
function Map() {
  const [viewport, setViewport] = useState({
    width: 400,
    height: 400,
    latitude: 37.7577,
    longitude: -122.4376,
    zoom: 8
  });

  return <ReactMapGL {...viewport} onViewportChange={setViewport} />;
}
export default Map;
